import React from "react";

export default function Meanings(props) {
  return (
    <div className="Meanings">
      <h1>{props.meanings.word}</h1>
      {props.meanings.meanings.map(function (meaning, index) {
        return <div key={index}></div>;
      })}
    </div>
  );
}
